import { createBrowserRouter, RouterProvider } from "react-router-dom";
function App() {
  const r = createBrowserRouter([
    {
      path:"/",
      element:<>
      <h1>dwaf</h1>
      </>
    }
  ])
  return <div className="App">
    <RouterProvider router={r}/>
  </div>;
}

export default App;
